Entry.Value:
// 2.5 Dim Julia Set
public override long InSet(double x, double y, double z, double br, double bi, double bj, double bk, long zkl, bool inverse) 
{
  additionalPointInfo.red=0;
  additionalPointInfo.green=0;
  additionalPointInfo.blue=0;

  double xx=x*x;
  double yy=y*y;
  double zz=z*z;
  int returnValue=0; 
  double r=xx+yy+zz;

  for (int n = 1; n < zkl; n++) 
  {

    if(r>bk) 
    {
      y=2*x*y;
      x=xx-yy;
      z=-z*Math.Sqrt(xx+yy+2.0*zz);
      x+=br;
      y+=bi;
      z+=bj;
    } 
    else
    {
      break; 
    }

    xx=x*x;yy=y*y;zz=z*z; 
    r=xx+yy+zz;

    if(n>10 && n<30) 
    {
      additionalPointInfo.red+=xx/r;
      additionalPointInfo.green+=yy/r;
      additionalPointInfo.blue+=zz/r;
    }

    if (r > 6) 
    { 
       returnValue = n; 
       break; 
    }

  }

  if (inverse) {
     if (returnValue == 0)
        returnValue = 1;
      else
        returnValue = 0;
  }
  return returnValue;
}
